import React, { Component } from 'react';
import { Route } from 'react-router-dom';
import { Color } from 'pages';
import "./App.css";

function LeftArea () {
    return (
      <div className = "left-area">
        <div className = "desin_system">
          Design
          System
          for ITRM
        </div>
        <div className = "style_guide">
          STYLE GUIDE
        </div>
        <div className = "style_guide_elements">
        <Route exact path="/" component={Color}/>
          Typography
          Icon
          Logo
        </div>
        <div className = "ui_component">
          UI Component
        </div>
        <div className = "ui_component_elements">
          Buttons
          Toggles
          Input Fields
          Dropdown Menus
          ToolTips & Markers
          Notifications
          Modals
          Empty States
          Date Pickers
          Grid List
          Data Tables
        </div>
      </div>
    );
  }
  
  
  
  function App() {
    return(
        <div>
          <LeftArea />
        </div>
      );
  }

export default App;
